import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Navbar, Nav } from 'react-bootstrap'
import axios from 'axios'

class App extends React.Component {

  constructor(props){
    super(props)
    state = {
      "companyList" : []
    }
  }

  componentDidMount() {
    axios.get('http://192.168.5.179:8000/companies')
    .then(function(res) {
      console.log("1", res)
      this.setState({"companyList": res.data.items})
    })
  }

  render() {
    return (
      <div className="App">
        <Navbar bg="dark" variant="dark">
            <Navbar.Brand>Demo</Navbar.Brand>
        </Navbar>

      </div>
    );
  }
}

export default App;
